import React,{useEffect} from 'react';
import {
    VictoryBar,
    VictoryChart,
    VictoryLine,
    VictoryPie,
  } from "victory";

const UserDetails = ({user}) => {


    return(
        <div className="graphs">
            <VictoryChart>
                <VictoryBar
                    data={[
                    { x: "lizard", y: 1234 },
                    { x: "snake", y: 2048 },
                    { x: "crocodile", y: 2600 },
                    { x: "alligator", y: 9000 },
                    ]}
                />
            </VictoryChart>
                <VictoryPie
                    data={[
                        { x: "lizard", y: 1234 },
                        { x: "snake", y: 2048 },
                        { x: "crocodile", y: 2600 },
                        { x: "alligator", y: 9000 },
                    ]}
                    />
        </div>
    )
}
export default UserDetails;
